import React, { Component } from 'react'
import PropTypes from 'prop-types'
import logo from './logo.svg';
import './App.css';
import Nav from './Nav';
import Shop from './Shop';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import {
  Accordion,
  Button,
  Container,
  Divider,
  Form,
  Grid,
  Header,
  Icon,
  Item,
  Image,
  List,
  Menu,
  Message,
  Responsive,
  Reveal,
  Segment,
  Sidebar,
  Table,
  Visibility,
  ListItem,
} from 'semantic-ui-react'

// function About() {
